from multiprocessing import Pool
import math
import genetic_alg_final

def run_pool(single_text):
    with Pool(processes=11) as procs:  # Adjust the number of processes as needed
        key_couplings = [[5, 5], [6, 6], [7, 7], [8, 8], [9, 9], [10, 10], [11, 11], [12, 12], [13, 13], [14, 14], [15, 15]]
        text_list = [single_text] * 11
        # Create a list of tuples for starmap
        arguments = list(zip(key_couplings, text_list))

        # Use starmap to execute the function in parallel
        results = procs.starmap(genetic_alg_final.loop_manager, arguments)
        
    return results

